@testset "7.3.2 (d x)^m (a+b arctanh(c x^n))^p" begin
    (a, b, c, d, m, n, p, x, ) = @variables a b c d m n p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*atanh(c*x^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*atanh(c*x^1))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*atanh(c*x))^p=#


    @test_int [x^5*(a + b*atanh(c*x)), x, 4, (b*x)/(6*c^5) + (b*x^3)/(18*c^3) + (b*x^5)/(30*c) - (b*atanh(c*x))/(6*c^6) + (1/6)*x^6*(a + b*atanh(c*x))]
    @test_int [x^4*(a + b*atanh(c*x)), x, 4, (b*x^2)/(10*c^3) + (b*x^4)/(20*c) + (1/5)*x^5*(a + b*atanh(c*x)) + (b*log(1 - c^2*x^2))/(10*c^5)]
    @test_int [x^3*(a + b*atanh(c*x)), x, 4, (b*x)/(4*c^3) + (b*x^3)/(12*c) - (b*atanh(c*x))/(4*c^4) + (1/4)*x^4*(a + b*atanh(c*x))]
    @test_int [x^2*(a + b*atanh(c*x)), x, 4, (b*x^2)/(6*c) + (1/3)*x^3*(a + b*atanh(c*x)) + (b*log(1 - c^2*x^2))/(6*c^3)]
    @test_int [x^1*(a + b*atanh(c*x)), x, 3, (b*x)/(2*c) - (b*atanh(c*x))/(2*c^2) + (1/2)*x^2*(a + b*atanh(c*x))]
    @test_int [x^0*(a + b*atanh(c*x)), x, 3, a*x + b*x*atanh(c*x) + (b*log(1 - c^2*x^2))/(2*c)]
    @test_int [(a + b*atanh(c*x))/x^1, x, 1, a*log(x) - (1/2)*b*PolyLog(2, (-c)*x) + (1/2)*b*PolyLog(2, c*x)]
    @test_int [(a + b*atanh(c*x))/x^2, x, 5, -((a + b*atanh(c*x))/x) + b*c*log(x) - (1/2)*b*c*log(1 - c^2*x^2)]
    @test_int [(a + b*atanh(c*x))/x^3, x, 3, -((b*c)/(2*x)) + (1/2)*b*c^2*atanh(c*x) - (a + b*atanh(c*x))/(2*x^2)]
    @test_int [(a + b*atanh(c*x))/x^4, x, 4, -((b*c)/(6*x^2)) - (a + b*atanh(c*x))/(3*x^3) + (1/3)*b*c^3*log(x) - (1/6)*b*c^3*log(1 - c^2*x^2)]
    @test_int [(a + b*atanh(c*x))/x^5, x, 4, -((b*c)/(12*x^3)) - (b*c^3)/(4*x) + (1/4)*b*c^4*atanh(c*x) - (a + b*atanh(c*x))/(4*x^4)]
    @test_int [(a + b*atanh(c*x))/x^6, x, 4, -((b*c)/(20*x^4)) - (b*c^3)/(10*x^2) - (a + b*atanh(c*x))/(5*x^5) + (1/5)*b*c^5*log(x) - (1/10)*b*c^5*log(1 - c^2*x^2)]


    @test_int [x^5*(a + b*atanh(c*x))^2, x, 16, (a*b*x)/(3*c^5) + (4*b^2*x^2)/(45*c^4) + (b^2*x^4)/(60*c^2) + (b^2*x*atanh(c*x))/(3*c^5) + (b*x^3*(a + b*atanh(c*x)))/(9*c^3) + (b*x^5*(a + b*atanh(c*x)))/(15*c) - (a + b*atanh(c*x))^2/(6*c^6) + (1/6)*x^6*(a + b*atanh(c*x))^2 + (23*b^2*log(1 - c^2*x^2))/(90*c^6)]
    @test_int [x^4*(a + b*atanh(c*x))^2, x, 14, (3*b^2*x)/(10*c^4) + (b^2*x^3)/(30*c^2) - (3*b^2*atanh(c*x))/(10*c^5) + (b*x^2*(a + b*atanh(c*x)))/(5*c^3) + (b*x^4*(a + b*atanh(c*x)))/(10*c) + (a + b*atanh(c*x))^2/(5*c^5) + (1/5)*x^5*(a + b*atanh(c*x))^2 - (2*b*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(5*c^5) - (b^2*PolyLog(2, 1 - 2/(1 - c*x)))/(5*c^5)]
    @test_int [x^3*(a + b*atanh(c*x))^2, x, 11, (a*b*x)/(2*c^3) + (b^2*x^2)/(12*c^2) + (b^2*x*atanh(c*x))/(2*c^3) + (b*x^3*(a + b*atanh(c*x)))/(6*c) - (a + b*atanh(c*x))^2/(4*c^4) + (1/4)*x^4*(a + b*atanh(c*x))^2 + (b^2*log(1 - c^2*x^2))/(3*c^4)]
    @test_int [x^2*(a + b*atanh(c*x))^2, x, 9, (b^2*x)/(3*c^2) - (b^2*atanh(c*x))/(3*c^3) + (b*x^2*(a + b*atanh(c*x)))/(3*c) + (a + b*atanh(c*x))^2/(3*c^3) + (1/3)*x^3*(a + b*atanh(c*x))^2 - (2*b*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(3*c^3) - (b^2*PolyLog(2, 1 - 2/(1 - c*x)))/(3*c^3)]
    @test_int [x^1*(a + b*atanh(c*x))^2, x, 6, (a*b*x)/c + (b^2*x*atanh(c*x))/c - (a + b*atanh(c*x))^2/(2*c^2) + (1/2)*x^2*(a + b*atanh(c*x))^2 + (b^2*log(1 - c^2*x^2))/(2*c^2)]
    @test_int [x^0*(a + b*atanh(c*x))^2, x, 5, (a + b*atanh(c*x))^2/c + x*(a + b*atanh(c*x))^2 - (2*b*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c - (b^2*PolyLog(2, 1 - 2/(1 - c*x)))/c]
    @test_int [(a + b*atanh(c*x))^2/x^1, x, 6, 2*(a + b*atanh(c*x))^2*atanh(1 - 2/(1 - c*x)) - b*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)) + b*(a + b*atanh(c*x))*PolyLog(2, -1 + 2/(1 - c*x)) + (1/2)*b^2*PolyLog(3, 1 - 2/(1 - c*x)) - (1/2)*b^2*PolyLog(3, -1 + 2/(1 - c*x))]
    @test_int [(a + b*atanh(c*x))^2/x^2, x, 4, c*(a + b*atanh(c*x))^2 - (a + b*atanh(c*x))^2/x + 2*b*c*(a + b*atanh(c*x))*log(2 - 2/(1 + c*x)) - b^2*c*PolyLog(2, -1 + 2/(1 + c*x))]
    @test_int [(a + b*atanh(c*x))^2/x^3, x, 8, -((b*c*(a + b*atanh(c*x)))/x) + (1/2)*c^2*(a + b*atanh(c*x))^2 - (a + b*atanh(c*x))^2/(2*x^2) + b^2*c^2*log(x) - (1/2)*b^2*c^2*log(1 - c^2*x^2)]
    @test_int [(a + b*atanh(c*x))^2/x^4, x, 8, -((b^2*c^2)/(3*x)) + (1/3)*b^2*c^3*atanh(c*x) - (b*c*(a + b*atanh(c*x)))/(3*x^2) + (1/3)*c^3*(a + b*atanh(c*x))^2 - (a + b*atanh(c*x))^2/(3*x^3) + (2/3)*b*c^3*(a + b*atanh(c*x))*log(2 - 2/(1 + c*x)) - (1/3)*b^2*c^3*PolyLog(2, -1 + 2/(1 + c*x))]
    @test_int [(a + b*atanh(c*x))^2/x^5, x, 13, -((b^2*c^2)/(12*x^2)) - (b*c*(a + b*atanh(c*x)))/(6*x^3) - (b*c^3*(a + b*atanh(c*x)))/(2*x) + (1/4)*c^4*(a + b*atanh(c*x))^2 - (a + b*atanh(c*x))^2/(4*x^4) + (2/3)*b^2*c^4*log(x) - (1/3)*b^2*c^4*log(1 - c^2*x^2)]


    @test_int [x^5*(a + b*atanh(c*x))^3, x, 33, (19*b^3*x)/(60*c^5) + (b^3*x^3)/(60*c^3) - (19*b^3*atanh(c*x))/(60*c^6) + (4*b^2*x^2*(a + b*atanh(c*x)))/(15*c^4) + (b^2*x^4*(a + b*atanh(c*x)))/(20*c^2) + (23*b*(a + b*atanh(c*x))^2)/(30*c^6) + (b*x*(a + b*atanh(c*x))^2)/(2*c^5) + (b*x^3*(a + b*atanh(c*x))^2)/(6*c^3) + (b*x^5*(a + b*atanh(c*x))^2)/(10*c) - (a + b*atanh(c*x))^3/(6*c^6) + (1/6)*x^6*(a + b*atanh(c*x))^3 - (23*b^2*(a + b*atanh(c*x))*log(2/(1 - c*x)))/(15*c^6) - (23*b^3*PolyLog(2, 1 - 2/(1 - c*x)))/(30*c^6)]
    @test_int [x^4*(a + b*atanh(c*x))^3, x, 24, (9*a*b^2*x)/(10*c^4) + (b^3*x^2)/(20*c^3) + (9*b^3*x*atanh(c*x))/(10*c^4) + (b^2*x^3*(a + b*atanh(c*x)))/(10*c^2) - (9*b*(a + b*atanh(c*x))^2)/(20*c^5) + (3*b*x^2*(a + b*atanh(c*x))^2)/(10*c^3) + (3*b*x^4*(a + b*atanh(c*x))^2)/(20*c) + (a + b*atanh(c*x))^3/(5*c^5) + (1/5)*x^5*(a + b*atanh(c*x))^3 - (3*b*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/(5*c^5) + (b^3*log(1 - c^2*x^2))/(2*c^5) - (3*b^2*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/(5*c^5) + (3*b^3*PolyLog(3, 1 - 2/(1 - c*x)))/(10*c^5)]
    @test_int [x^3*(a + b*atanh(c*x))^3, x, 18, (b^3*x)/(4*c^3) - (b^3*atanh(c*x))/(4*c^4) + (b^2*x^2*(a + b*atanh(c*x)))/(4*c^2) + (b*(a + b*atanh(c*x))^2)/c^4 + (3*b*x*(a + b*atanh(c*x))^2)/(4*c^3) + (b*x^3*(a + b*atanh(c*x))^2)/(4*c) - (a + b*atanh(c*x))^3/(4*c^4) + (1/4)*x^4*(a + b*atanh(c*x))^3 - (2*b^2*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c^4 - (b^3*PolyLog(2, 1 - 2/(1 - c*x)))/c^4]
    @test_int [x^2*(a + b*atanh(c*x))^3, x, 12, (a*b^2*x)/c^2 + (b^3*x*atanh(c*x))/c^2 - (b*(a + b*atanh(c*x))^2)/(2*c^3) + (b*x^2*(a + b*atanh(c*x))^2)/(2*c) + (a + b*atanh(c*x))^3/(3*c^3) + (1/3)*x^3*(a + b*atanh(c*x))^3 - (b*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/c^3 + (b^3*log(1 - c^2*x^2))/(2*c^3) - (b^2*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/c^3 + (b^3*PolyLog(3, 1 - 2/(1 - c*x)))/(2*c^3)]
    @test_int [x^1*(a + b*atanh(c*x))^3, x, 8, (3*b*(a + b*atanh(c*x))^2)/(2*c^2) + (3*b*x*(a + b*atanh(c*x))^2)/(2*c) - (a + b*atanh(c*x))^3/(2*c^2) + (1/2)*x^2*(a + b*atanh(c*x))^3 - (3*b^2*(a + b*atanh(c*x))*log(2/(1 - c*x)))/c^2 - (3*b^3*PolyLog(2, 1 - 2/(1 - c*x)))/(2*c^2)]
    @test_int [x^0*(a + b*atanh(c*x))^3, x, 5, (a + b*atanh(c*x))^3/c + x*(a + b*atanh(c*x))^3 - (3*b*(a + b*atanh(c*x))^2*log(2/(1 - c*x)))/c - (3*b^2*(a + b*atanh(c*x))*PolyLog(2, 1 - 2/(1 - c*x)))/c + (3*b^3*PolyLog(3, 1 - 2/(1 - c*x)))/(2*c)]
    @test_int [(a + b*atanh(c*x))^3/x^1, x, 8, 2*(a + b*atanh(c*x))^3*atanh(1 - 2/(1 - c*x)) - (3/2)*b*(a + b*atanh(c*x))^2*PolyLog(2, 1 - 2/(1 - c*x)) + (3/2)*b*(a + b*atanh(c*x))^2*PolyLog(2, -1 + 2/(1 - c*x)) + (3/2)*b^2*(a + b*atanh(c*x))*PolyLog(3, 1 - 2/(1 - c*x)) - (3/2)*b^2*(a + b*atanh(c*x))*PolyLog(3, -1 + 2/(1 - c*x)) - (3/4)*b^3*PolyLog(4, 1 - 2/(1 - c*x)) + (3/4)*b^3*PolyLog(4, -1 + 2/(1 - c*x))]
    @test_int [(a + b*atanh(c*x))^3/x^2, x, 5, c*(a + b*atanh(c*x))^3 - (a + b*atanh(c*x))^3/x + 3*b*c*(a + b*atanh(c*x))^2*log(2 - 2/(1 + c*x)) - 3*b^2*c*(a + b*atanh(c*x))*PolyLog(2, -1 + 2/(1 + c*x)) - (3/2)*b^3*c*PolyLog(3, -1 + 2/(1 + c*x))]
    @test_int [(a + b*atanh(c*x))^3/x^3, x, 7, (3/2)*b*c^2*(a + b*atanh(c*x))^2 - (3*b*c*(a + b*atanh(c*x))^2)/(2*x) + (1/2)*c^2*(a + b*atanh(c*x))^3 - (a + b*atanh(c*x))^3/(2*x^2) + 3*b^2*c^2*(a + b*atanh(c*x))*log(2 - 2/(1 + c*x)) - (3/2)*b^3*c^2*PolyLog(2, -1 + 2/(1 + c*x))]
    @test_int [(a + b*atanh(c*x))^3/x^4, x, 14, -((b^2*c^2*(a + b*atanh(c*x)))/x) + (1/2)*b*c^3*(a + b*atanh(c*x))^2 - (b*c*(a + b*atanh(c*x))^2)/(2*x^2) + (1/3)*c^3*(a + b*atanh(c*x))^3 - (a + b*atanh(c*x))^3/(3*x^3) + b^3*c^3*log(x) - (1/2)*b^3*c^3*log(1 - c^2*x^2) + b*c^3*(a + b*atanh(c*x))^2*log(2 - 2/(1 + c*x)) - b^2*c^3*(a + b*atanh(c*x))*PolyLog(2, -1 + 2/(1 + c*x)) - (1/2)*b^3*c^3*PolyLog(3, -1 + 2/(1 + c*x))]
    @test_int [(a + b*atanh(c*x))^3/x^5, x, 16, -((b^3*c^3)/(4*x)) + (1/4)*b^3*c^4*atanh(c*x) - (b^2*c^2*(a + b*atanh(c*x)))/(4*x^2) + b*c^4*(a + b*atanh(c*x))^2 - (b*c*(a + b*atanh(c*x))^2)/(4*x^3) - (3*b*c^3*(a + b*atanh(c*x))^2)/(4*x) + (1/4)*c^4*(a + b*atanh(c*x))^3 - (a + b*atanh(c*x))^3/(4*x^4) + 2*b^2*c^4*(a + b*atanh(c*x))*log(2 - 2/(1 + c*x)) - b^3*c^4*PolyLog(2, -1 + 2/(1 + c*x))]


