    @test_int [(d*x)^(5/2)*(a + b*atanh(c*x)), x, 7, (4*b*d^2*sqrt(d*x))/(7*c^3) + (4*b*(d*x)^(5/2))/(35*c) - (2*b*d^(5/2)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(7*c^(7/2)) + (2*(d*x)^(7/2)*(a + b*atanh(c*x)))/(7*d) - (2*b*d^(5/2)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(7*c^(7/2))]
    @test_int [(d*x)^(3/2)*(a + b*atanh(c*x)), x, 6, (4*b*(d*x)^(3/2))/(15*c) + (2*b*d^(3/2)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(5*c^(5/2)) + (2*(d*x)^(5/2)*(a + b*atanh(c*x)))/(5*d) - (2*b*d^(3/2)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(5*c^(5/2))]
    @test_int [(d*x)^(1/2)*(a + b*atanh(c*x)), x, 6, (4*b*sqrt(d*x))/(3*c) - (2*b*sqrt(d)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(3*c^(3/2)) + (2*(d*x)^(3/2)*(a + b*atanh(c*x)))/(3*d) - (2*b*sqrt(d)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(3*c^(3/2))]
    @test_int [(a + b*atanh(c*x))/(d*x)^(1/2), x, 5, (2*b*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(sqrt(c)*sqrt(d)) + (2*sqrt(d*x)*(a + b*atanh(c*x)))/d - (2*b*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(sqrt(c)*sqrt(d))]
    @test_int [(a + b*atanh(c*x))/(d*x)^(3/2), x, 5, (2*b*sqrt(c)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/d^(3/2) - (2*(a + b*atanh(c*x)))/(d*sqrt(d*x)) + (2*b*sqrt(c)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/d^(3/2)]
    @test_int [(a + b*atanh(c*x))/(d*x)^(5/2), x, 6, -((4*b*c)/(3*d^2*sqrt(d*x))) - (2*b*c^(3/2)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(3*d^(5/2)) - (2*(a + b*atanh(c*x)))/(3*d*(d*x)^(3/2)) + (2*b*c^(3/2)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(3*d^(5/2))]
    @test_int [(a + b*atanh(c*x))/(d*x)^(7/2), x, 6, -((4*b*c)/(15*d^2*(d*x)^(3/2))) + (2*b*c^(5/2)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(5*d^(7/2)) - (2*(a + b*atanh(c*x)))/(5*d*(d*x)^(5/2)) + (2*b*c^(5/2)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(5*d^(7/2))]
    @test_int [(a + b*atanh(c*x))/(d*x)^(9/2), x, 7, -((4*b*c)/(35*d^2*(d*x)^(5/2))) - (4*b*c^3)/(7*d^4*sqrt(d*x)) - (2*b*c^(7/2)*atan((sqrt(c)*sqrt(d*x))/sqrt(d)))/(7*d^(9/2)) - (2*(a + b*atanh(c*x)))/(7*d*(d*x)^(7/2)) + (2*b*c^(7/2)*atanh((sqrt(c)*sqrt(d*x))/sqrt(d)))/(7*d^(9/2))]


